import { type } from "@testing-library/user-event/dist/type";
import { useState } from "react";

function Form(){
    const [name, setName] = useState('false');
    const setNameHandler=()=>{
        if(name==="false"){
            setName("true");
        }else{
            setName("false");
}}
    return(
        <>
        <form id='form' >
            <div id='heading'><h1>Registration Form</h1></div>

            <label htmlFor="name">Name:</label>
            <input type="text" placeholder="Enter your name"/>
            <br/>
            <label htmlFor="email">Email:</label>
            <input type="email" placeholder="Enter your email"/>
            <br/>
            <label htmlFor="password">Password:</label>
            <input type={name === "true" ? "text" : "password"}
             placeholder="Enter your password"/>
            <button>
                <span onClick={setNameHandler}>Show Password</span>
            </button>
            <br/>
            <label htmlFor="confirm-password">Confirm Password:</label>
            <input type="password" placeholder="Confirm your password"/>
            <br/>
            <label htmlFor="roll-number">Roll-number:</label>
            <input type="text" placeholder="Enter your roll number"/>
            <br/>
            <label htmlFor="department">Department:</label>
            <input type="text" placeholder="Enter your department"/>
            <br/>
            <label htmlFor="session">Session:</label>
            <input type="number" placeholder="Enter your session"/>
            <br/>
            <button type="submit" >Submit</button>
        </form>
        </>
    );
}
export default Form;
